{"Text Review": "sudah masuk,, sudah lengkap,, hampir 1bulan tapi saya belum terdaftar menjadi mitra GO-JEK, tidak ada tanda2. maaf, saya sangat kecewa...", "Rating": "5", "Tanggal": "8 Februari 2019", "Nama User": ""}
{"Text Review": "kemarin saya di telfn orang tidak di kenal, mengatas namakan gojek, bilang saya dapat penghargaan 2,5jta dengan syarat harus ke atm dan memasukan sms dari gojek, karena mencurigakan saya tidak mau, dan si penelepon marah2 dan akan memblokir akun saya karena bermasalah, ternyata ancaman nya benar akun saya di blokir. mohon klarifikasi dari pihak gojek tentang pengaduan penipuan yang mengatas namakan gojek, aplikasi favorit saya. kalau kaya gini saya malah jadi takut. mohon untukk gojek segera", "Rating": "1", "Tanggal": "7 Februari 2019", "Nama User": "Rief Sanjaya"}
